import './App.css';

function App() {
	return (
		<div className="container">
			<div className="logo"> logo</div>
			<div className="header">header </div>
			<div className="nav">nav </div>
			<div className="content">content</div>
			<div className="footer">footer </div>
		</div>
	);
}

export default App;
